GT Racer: Season Two Collection

Technology Documentary with no narration published by Discovery Channel in 2008 - English language


Information
------------------------------

Historic racing is a worldwide, fast growing phenomenon where colorful characters live out their most sophisticated, car-crazed dreams. GT RACER takes the viewer literally inside the cars and onto the tracks. In Season II twelve idiosyncratic race teams give a peek at the most spectacular series of international classic racing, where the most beautiful classic racers ever built battle it out on the world's most glamorous racing circuits: Bizzarrinis, Ferraris, Jaguars, Morgans, Mustangs and Cobras race at the great circuits of Europe. The first episode, shot at the 2008 Le Mans Classic , takes a look at what it s like to race classic race cars day and night at the single most iconic tracks of all times - immortalized by none other than Steve McQueen himself.

3)  Magny Cours - Fast Curves 
The third episode brings one to Magny Cours, France s grand prix circuit. Built for formula-one cars, this track makes an interesting playground for historic racers. The Masters Series Festival at Magny Cours is a showdown in sideways drifts with its three-hour endurance race as the main highlight.

